import useFetch from '../../hooks/useFetch';
import './propertyList.css';

const PropertyList = () => {
  const { data, loading, error } = useFetch('/hotels/countByType');

  const images = [
    'https://content.pymnts.com/wp-content/uploads/2016/05/Hotel-Room-Secondary-Market.jpg',
    'https://thumbs.dreamstime.com/b/apartment-building-balconies-photoof-34869405.jpg',
    'https://media-cdn.tripadvisor.com/media/photo-m/1280/15/9b/44/ca/nirali-resorts.jpg',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
  ];
  return (
    <div className="pList">
      {loading ? (
        'loading'
      ) : (
        <>
          {data &&
            images.map((img, i) => (
              <div className="pListItem" key={i}>
                <img src={img} alt="" className="pListImg" />
                <div className="pListTitles">
                  <h1>{data[i]?.type}</h1>
                  <h2>
                    {data[i]?.count} {data[i]?.type}
                  </h2>
                </div>
              </div>
            ))}
        </>
      )}
    </div>
  );
};

export default PropertyList;
